import styled from "styled-components";

export const Container = styled.div`
	display: flex;
	justify-content: center;
`;

export const Logo = styled.div`
	.logo-container {
		display: flex;
		flex-direction: column;
		align-items: center;
	}
	.logo-image {
		height: 100px;
		width: auto;
	}
`;
